@maht0rz. from the stack trace, I think the following happens:
- during the first proof, the address is set to a variable
- during the second transaction, before running the proof, just inside the transaction callback, for some reason you use the same variable that was created for the proof before. In this situation, the variable has no meaning -- there is no active circuit or anything, the tx callback runs outside the circuit first, and that's where the error comes from
